    false,nt"url": null,nt"notes": "The data included in this dataset were
    collected in East Greenland in the Sermilik Fjord, located in the Ammassalik district
    close to the town of Tasiilaq and at the Kangerdlugssuaq Glacier. Data collection
    was conducted by deploying eleven moorings from August 2009 to August 2010. One
    mooring was not recovered until Septmeber 2012 and three moorings wet never recovered.
    The recovered moorings located in the Sermilik Fjord were named CM1, CM3, CM5, CM6,
    and SM3. The recovered moorings located at Kangerdlugssuaq Glacier were GP1, GP2,
    and GP3. The moorings were equipped with SBE MicroCATs, Onset UTBI-001 TidbiTs,
    Nortek Aquadopps, RBR DR-1050s, and RBR XR-420s.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
